    true,nt"url": null,nt"notes": "According to its records, the Ethics Commission
    has identified the campaign finance disclosure filers in this table as non-responsive
    (NR) filers.  NR filers are those that have not responded to two or more written
    notices and one or more verbal notices regarding past-due reporting.  Please note
    that Ethics Commission records are subject to change and the table below may not
    include all NR filers or reflect recent activity.  The NR filers are encouraged
    to contact the Commission because continued failure to file may result in an enforcement
    action.  Posted NR filers are removed from the list after filing their past-due
